import React from 'react';
import './App.css';

function App() {
  return (
    <div className="app">
      <div className="content">
        <div className="header-text">
          TECNOLÓGICO DE MONTERREY
        </div>
        
        <div className="main-text">
          LEM129
        </div>
        
        <div className="footer-text">
          VEINTINUEVE DE JUNIO DEL DOS MIL VEINTICINCO
        </div>
      </div>
    </div>
  );
}

export default App;
